import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import { 
  RiMap2Line, 
  RiCalendarLine, 
  RiBookLine, 
  RiBarChartLine, 
  RiSettings4Line,
  RiUser3Line,
  RiMenuLine,
  RiLogoutBoxRLine
} from 'react-icons/ri';
import './Layout.css';

function Layout({ children }) {
  const [isSidebarCollapsed, setIsSidebarCollapsed] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  // Get user name from localStorage
  let userName = 'Traveler';
  try {
    const user = JSON.parse(localStorage.getItem('user'));
    if (user && user.name) userName = user.name;
  } catch {}

  const handleLogout = () => {
    localStorage.clear();
    navigate('/login');
  };

  return (
    <div className="layout">
      <aside className={`sidebar ${isSidebarCollapsed ? 'collapsed' : ''}`}>
        <div className="sidebar-header">
          <button 
            className="hamburger-button"
            onClick={() => setIsSidebarCollapsed(!isSidebarCollapsed)}
          >
            <RiMenuLine />
          </button>
          <h1>India Travel</h1>
        </div>
        <nav className="sidebar-nav">
          <ul>
            <li className={location.pathname === '/dashboard' ? 'active' : ''} onClick={() => navigate('/dashboard')}>
              <span className="nav-icon"><RiMap2Line /></span>
              <span>Map Overview</span>
            </li>
            <li className={location.pathname === '/planner' ? 'active' : ''} onClick={() => navigate('/planner')}>
              <span className="nav-icon"><RiCalendarLine /></span>
              <span>Travel Planner</span>
            </li>
            <li className={location.pathname === '/journal' ? 'active' : ''} onClick={() => navigate('/journal')}>
              <span className="nav-icon"><RiBookLine /></span>
              <span>Travel Journal</span>
            </li>
            <li className={location.pathname === '/statistics' ? 'active' : ''} onClick={() => navigate('/statistics')}>
              <span className="nav-icon"><RiBarChartLine /></span>
              <span>Statistics</span>
            </li>
            <li className={location.pathname === '/settings' ? 'active' : ''} onClick={() => navigate('/settings')}>
              <span className="nav-icon"><RiSettings4Line /></span>
              <span>Settings</span>
            </li>
          </ul>
        </nav>
        <div className="sidebar-footer">
          <div className="user-info">
            <div className="user-avatar">
              <RiUser3Line />
            </div>
            <div className="user-details">
              <span className="user-name">{userName}</span>
              <span className="user-status">Planning next trip</span>
            </div>
          </div>
          <button className="logout-btn" onClick={handleLogout}>
            <RiLogoutBoxRLine style={{ marginRight: 8, fontSize: 20 }} /> Logout
          </button>
        </div>
      </aside>
      <main className="main-content">
        <div className="content-wrapper">
          {children}
        </div>
      </main>
    </div>
  );
}

export default Layout;
